INSERT INTO `host_lang` VALUES (1,1,'en','Blue Bay Village Camping','The Blue of the water and the white of the sand for your vacations','The campsite is in front of the main beach, with bungalows, pitches under threes shade, and mobile homes','The campsite is in front of the main beach, with bungalows, pitches under threes shade, and mobile homes. Restaurant and swimming pool at customer disposal, there is also a market for daily shopping. On the beach the diving club is available for diving experiences, shuttle service every hour could bring you to the nearest town.','1) Before making a reservation it is necessary to phone or send an e-mail to\r\nour booking office in order to check availability. The booking is valid only\r\nafter having received a written confirmation from Camping-Village Eurcamping.\r\n2) On signing the booking form you are kindly requested to observe both the above\r\nmentioned RULES and CAMPSITE REGULATIONS as subscribed. In case the\r\nundersigned or one of the member does not respect the rules, the management\r\ncan cancel the above mentioned agreement.\r\n3) Cancellation can be made only by registered post or by fax. On cancellation, the\r\nmanagement will give back 70% of the initial deposit only if the notification is\r\nreceived 20 days before the planned date of arrival. In a different way no\r\nrepayment will take place.\r\n4) In case of terminating the holiday earlier than planned, customers are still required\r\nto pay 50% of the price of the remaining time booked on the campsite in addition\r\nto the price of the actual stay.\r\n5) Confirmed reservations cannot be transfer to another person with the exception of\r\nspecial written agreements and at the description of the management.\r\n6) In case guests are not arriving on the expected day, the campsite management\r\nwill keep the emplacement or bungalow reserved until 02.00 p.m the day after the\r\narrival, later than, guests renounce at the reservation, if we do not receive any\r\nmessages by telephone, fax or e-mail.','1. Our guests can receive visitors during the day. Day visitors must report to reception on arrival on site and must observe all the rules provided by the campsite. In addition, visitors are required to pay the daily fee due for their visit and to leave the campsite by 10.00 p.m. on the day of arrival.\r\n\r\n2. The day of the stay begins at 3.00 p.m. and ends at 10.00 a.m. the following day. By this time at the latest, the pitch / mobilehome must be vacated and clean. Departures before 7 a.m. are not permitted.\r\n\r\n3. In the event of late arrival or early departure, the agreed price will be charged in full for the entire reservation period. Guests who arrive without a booking, on the other hand, are required to only pay for the vacation days that they actually spent with us.\r\n\r\n4. The campsite pitches are numbered and are allocated to our guests by the management. Our guests agree to this and have to adhere to this allocation. All equipment, including vehicles, must be neatly placed within the parking space.\r\n\r\n5. Dogs are allowed on the campsite pitches, provided that they do not disturb the other guests of the campsite. Dogs must always be kept on a lead. Pet owners are required to clean up after their pets. Furthermore, dog owners are liable for any damage to people and objects caused by their animals. It is not allowed to leave dogs unattended inside or outside your accommodation.\r\n\r\n6. Between 11.00 p.m. and 07.00 a.m. it is quiet time. Musical instruments, CD players, radios, televisions and other appliances must not be used during this time. In the interest of all site guests, we ask you to avoid any other disturbing noise - including erecting or dismantling tents. Between 11.00 p.m. and 7.00 a.m., the barrier at the entrance and exit is closed, so no vehicles are allowed to enter the campsite.\r\n\r\n7. It is strictly forbidden: to damage the vegetation and / or equipment of the campsite; to delimit the parking spaces with ditches and fences; to pour oils, fuels, boiling, salted, or waste liquids on the ground. You must not dig any holes or trenches on the campsite (pitches). Please wash or rinse your laundry and dishes in the dedicated equipped rooms only. According to the hygiene and sanitary regulations, you have to place a waste water bucket under the drain on the vehicle floor of your caravan. The motorhome toilets and other liquid waste must only be emptied or disposed of at the designated disposal points. You also attach great importance to cleanliness and order. When using the toilet and shower block, it is assumed that all guests are always careful and considerate. Please help us to keep the estate and facilities clean and tidy!\r\n\r\n8. Charcoal grills are allowed as long as the smoke does not disturb the neighbours and the lawn or the floor is not damaged.\r\n\r\n9. Dogs are not allowed in the swimming pool. Ball games and air mattresses are also not allowed. Jumping from the edge of the pool is prohibited!\r\n\r\n10. Each guest has to take care of his own personal belongings. The management guarantees continuous monitoring of the campsite, but is not liable for any theft or loss. Always take good care of your belongings yourself and take the necessary precautionary measures. Money and valuables should not be lying around unguarded in caravans, tents and accommodations.\r\n\r\n11. Any interruptions in the electricity or water supply, which are caused by failures or due to reasons of force majeure, do not oblige the campsite to grant a price reimbursement.\r\n\r\n12. The campsite is also not liable for any damage caused by storms (wind, hail, falling branches).\r\n\r\n13. The use of sports and leisure equipment, swimming pool, playground, soccer and volleyball field, etc. is at your own risk. Minors are only allowed to use the sanitary facilities or the campsite equipment when accompanied by a supervisor. The management rejects any liability for any accidents.\r\n\r\n14. Children should always be accompanied by their parents during the entertainment activities. The management is not liable for any accidents that may happen to unsupervised children. The entertainment staff does not offer childcare.','nside the airport one of our teamers will meet your child at the exit after baggage claim. On the return trip we will ensure that your child is checked-in properly and enters the security check. Please make sure you inform us at the latest 4 weeks prior to departure and provide travelling times and flight numbers and note the different airline regulations regarding children travelling alone. At some airports we offer the McDonald\'s restaurant as a meeting point, e.g. for parents who fly together with their children or for children who live nearby and do not travel by plane. '),(2,2,'en','Sun and Sea Camping','The family Experience','The campsite is all covered by threes for a fresh relax during all the summer.','Located at 4 km from the village of SOSPEL, situated in a privileged natural surroundings, open from 15 April to 30 September.\r\n\r\nThe camping welcomes you with there 90 pitches including 13 accommodation on a terrain of more than 3 hectares of land and terraces.\r\nCaravans and motorhomes are welcome and will have a place on the lower part of the campsite, the upper part is not being accessible to campers and large vehicles.\r\nAll the spots have a 10 A electrical hook-up (for some of you, make sure having an extension cord).\r\n\r\nA swimming pool is open on all season and free for our residents.\r\n\r\nWe hope that the charm and authenticity of this place will please you.\r\n\r\nAccessibility: the campsite has a pitch and a shower and toilet for people with reduced mobility, but the terrain because of its topography is hard in accessibility.','Check-in and Check-Out:\r\nCheck-ins are accepted until 18.00, If you plan to arrive later than that time, please contact us as soon as possible to let us know (max. until 23.00). Places are to be freed by 11.00 on the departure day and mobile homes by 10.00.\r\n\r\nMinimum stay\r\nA minimum stay is not required to book camping pitches. The minimum stay is stated in the price list for booking mobile homes.\r\n\r\nDeposit for booking\r\nThe reservation is confirmed upon receipt of the deposit, equal to 30% of the total amount of the stay, communicated at the time of booking, fee of stay not included. The minimum amount requied for the deposit is 21,00€.\r\n\r\nBooking cancellations and no-shows\r\n\r\nIt is possible to cancel your reservation free of charge up to 21 days before the arrival date, net of 2€ of transaction costs. In all other cases, including no show, for any reason the deposit will not be refunded.\r\n\r\nPayment method for the deposit\r\nIt is possible to pay the deposit by bank transfer to:\r\n\r\nBellavista Riviera S.n.c. by Curzel Cristina & C.\r\nIBAN: IT41 A058 5635 2200 7757 1378 215\r\nBank: Banca Popolare dell’Alto Adige S.p.a.\r\nBIC / SWIFT: BPAAIT2B077\r\n\r\nindicating in the reason for payment the associated booking number, provided by the campsite reception.\r\n\r\nPayment of the remaining amount\r\nThe remaining amount can be paid directly on the campsite:\r\n\r\n• for mobile home reservations upon arrival day\r\n• for pitch reservations within the day before the scheduled departure.\r\n\r\nYou can pay your account with cash, debit card, credit card on the circuit VISA / MASTERCARD.\r\n\r\nOnly for the amount of the tourist tax the use of cash is required. Checks are not accepted.\r\n\r\nPlease pay your bill during only in this time: 8.00 – 11.00 and 17.00 – 19.00.\r\n','No one likes hearing about rules (at least, we think), but our campsite rules are created with you in mind, and help to ensure that everyone on-site has the best possible experience. \r\n\r\nWe know there won’t be any problems, but to safeguard your holiday and relaxation we respectfully ask that everyone adheres to the following:\r\n\r\nReception\r\nOpening times will be displayed at Reception. When Reception is closed an emergency contact number for the Site Manager will be displayed on the door. Local tourist information is available at Reception. For more information on the area, please do not hesitate to ask the Site Manager.\r\n\r\nArrival/Departure\r\nPitches are available from noon on the day of your arrival. You are requested to vacate your pitch by 11 am on your day of departure. If you wish to extend your stay, please contact Reception before 10.00 am on your expected departure date. Permits issued at Reception must be on display at all times.\r\n\r\nLate Arrivals\r\nYou may pitch before or by dusk.\r\n\r\nIf you arrive when Reception is closed, please call the telephone number located on the Reception door. The sites generally open between 7.30am and 10.30pm but this will vary depending on the site.\r\n\r\nPitches\r\nPlease note that due to fire regulations you must pitch at least three, preferably six, metres away from anyone else. Unfortunately if this rule is not adhered to you may be asked to repitch (and no one likes that).\r\n\r\nYou will find fire extinguishers in prominent places around the site, please make yourself aware of where these are located. One windbreak is permitted per pitch, with a maximum of six poles. \r\n\r\nSpeed Limit\r\nThe speed limit on-site is 5mph. As there are often young children playing, we ask you to take special care when driving on-site.\r\n\r\nPlease drive slowly past horses.\r\n\r\nGenerators\r\nGenerators are only allowed if specified by the management. Where generators are allowed, please abide by the times we allow these to run.\r\n\r\nBarbecues\r\nBecause of the danger of fires in the forest, open fires are not allowed on-site.\r\n\r\nAny barbecues used on our sites should be specifically designed and used only for the purpose of cooking food (i.e not firepits).  They should be robust, secure and able to be raised off of the forest floor, there should no damage or marks left on the ground where they have been used. In support of the New Forest Action Plan we are asking campers not to bring disposable barbecues for their stay. We are also reminding campers that outside of our sites no barbecues of any kind are now allowed anywhere in the New Forest.\r\n\r\nPlease ensure the smoke and fumes do not annoy other site users. In times of very dry weather, when the fire risk is high, the use of barbecues may be restricted. For more information on this please view Forestry England\'s helpful advice page.\r\n\r\nDogs\r\nWe offer dog-friendly caravan and camping holidays at most of our sites. However we request that dogs must be kept on a leash at all times whilst on-site. Please be courteous and always clean up after your dog. There is a maximum of three dogs per pitch.\r\n\r\nEnvironment\r\nFor health and safety reasons, we do not permit visitors to hang any items on the forest trees. Hammocks, washing lines and tree swings are strictly prohibited on all Camping in the Forest sites.\r\n\r\nLikewise we do not permit fireworks or den building on or around the pitches.\r\n\r\nWildlife\r\n\r\nPlease do not feed the animals in and around our sites.\r\n\r\nNoise\r\nPlease keep noise at a level which will not disturb other site users, especially between 10.30pm and 8.00am.\r\n\r\nCycling\r\nPlease take care when cycling. You can cycle on public roads, byways open to all traffic, public bridleways, restricted bridleways, and dedicated cycle routes. Cycling on public footpaths is also not permitted.\r\n\r\nBe safe around animals, pass them slowly and wide and to one side if possible. Close gates behind you so the animals don’t stray. Keep to a safe speed, and be polite to other cyclists, motorists, pedestrians and residents.','\r\nArrival by public transport\r\n\r\nArrival by train: Take the 400 line, get off at Dobbiaco and take the 445 bus to the Lago di Dobbiaco stop - our campsite and the Skyview Chalets are 200 metres from the bus stop.\r\n \r\nArrival with the Südtirol Transfer\r\n\r\nIf you arrive in South Tyrol by train or bus, the \"Südtirol Transfer\" shuttle service can take you the last few kilometres to your accommodation: The shuttle buses go from the stations of Bolzano, Merano, Malles, Bressanone, Brunico and San Candido and from the long-distance bus stops of Bolzano, Chiusa, Varna, Vipiteno and Merano; and, at the end of your stay, they will take you back to the bus stop. You can book this service at www.suedtiroltransfer.com .\r\n'),(3,1,'it','Blue Bay Village Campeggio','L\'azzurro dell\'acqua e il bianco della sabbia per le tue vacanze','Il campeggio si trova di fronte alla spiaggia principale, con bungalow, piazzole sotto ombra e case mobili','Il campeggio si trova di fronte alla spiaggia principale, con bungalow, piazzole sotto ombra e case mobili. Ristorante e piscina a disposizione dei clienti, c\'è anche un market per la spesa quotidiana. In spiaggia il diving club è a disposizione per esperienze subacquee, servizio navetta ogni ora potrebbe portarvi al paese più vicino.','1) Prima di effettuare una prenotazione è necessario telefonare o inviare una e-mail a\r\nil nostro ufficio prenotazioni per verificare la disponibilità. La prenotazione è valida solo\r\ndopo aver ricevuto conferma scritta da Camping-Village Eurcamping.\r\n2) Al momento della sottoscrizione del modulo di prenotazione siete pregati di osservare entrambi quanto sopra\r\nmenzionato REGOLAMENTO e REGOLAMENTO DEL CAMPEGGIO come sottoscritto. Nel caso il\r\nsottoscritto o uno dei soci non rispetta le regole, la direzione\r\npuò annullare il suddetto contratto.\r\n3) La cancellazione può essere effettuata solo a mezzo raccomandata o fax. In caso di annullamento, il\r\nla direzione restituirà il 70% del deposito iniziale solo se la notifica lo è\r\nricevuto 20 giorni prima della data di arrivo prevista. In modo diverso n\r\navverrà il rimborso.\r\n4) In caso di disdetta del soggiorno prima del previsto, i clienti sono comunque tenuti\r\npagare in aggiunta il 50% del prezzo del tempo rimanente prenotato in campeggio\r\nal prezzo del soggiorno effettivo.\r\n5) Le prenotazioni confermate non possono essere trasferite ad altra persona ad eccezione di\r\nspeciali accordi scritti e alla descrizione della direzione.\r\n6) In caso di mancato arrivo degli ospiti nel giorno previsto, la direzione del campeggio\r\nmanterrà la piazzola o il bungalow riservato fino alle ore 14:00 del giorno successivo al\r\narrivo, oltre, gli ospiti rinunciano alla prenotazione, se non ne riceviamo\r\nmessaggi per telefono, fax o e-mail.','1. I nostri ospiti possono ricevere visitatori durante il giorno. I visitatori giornalieri devono presentarsi alla reception all\'arrivo in loco e devono osservare tutte le regole previste dal campeggio. Inoltre i visitatori sono tenuti al pagamento della quota giornaliera dovuta per la loro visita e di lasciare il campeggio entro le ore 22:00. il giorno di arrivo.\r\n\r\n2. Il giorno del soggiorno inizia alle ore 15:00. e termina alle ore 10:00 del giorno successivo. Al più tardi a quest\'ora, la piazzola/casa mobile deve essere lasciata libera e pulita. Non sono ammesse partenze prima delle ore 7:00.\r\n\r\n3. In caso di arrivo posticipato o partenza anticipata, il prezzo pattuito verrà addebitato per intero per l\'intero periodo di prenotazione. Gli ospiti che arrivano senza prenotazione, invece, sono tenuti a pagare solo i giorni di vacanza effettivamente trascorsi con noi.\r\n\r\n4. Le piazzole del campeggio sono numerate e assegnate ai nostri ospiti dalla direzione. I nostri ospiti sono d\'accordo e devono aderire a questa assegnazione. Tutte le attrezzature, compresi i veicoli, devono essere sistemate ordinatamente all\'interno del parcheggio.\r\n\r\n5. I cani sono ammessi nelle piazzole del campeggio, purché non arrechino disturbo agli altri ospiti del campeggio. I cani devono essere sempre tenuti al guinzaglio. I proprietari di animali domestici sono tenuti a pulire dopo i loro animali domestici. I proprietari di cani sono inoltre responsabili per eventuali danni a persone e cose causati dai loro animali. Non è consentito lasciare i cani incustoditi all\'interno o all\'esterno del proprio alloggio.\r\n\r\n6. Tra le 23:00 e le 07:00 è ora di quiete. Durante questo periodo non devono essere utilizzati strumenti musicali, lettori CD, radio, televisori e altri apparecchi. Nell\'interesse di tutti gli ospiti del sito, ti chiediamo di evitare qualsiasi altro rumore fastidioso, incluso il montaggio o lo smontaggio di tende. Tra le 23:00 e alle ore 7.00 la barriera all\'ingresso e all\'uscita è chiusa, quindi non è consentito l\'ingresso di veicoli nel campeggio.\r\n7. È severamente vietato: danneggiare la vegetazione e/o le attrezzature del campeggio; delimitare i parcheggi con fossi e recinzioni; versare sul terreno olii, combustibili, liquidi bollenti, salati o di scarto. Non è consentito scavare buche o trincee nel campeggio (piazzole). Si prega di lavare o risciacquare il bucato e le stoviglie solo negli appositi locali attrezzati. Secondo le norme igienico-sanitarie, è necessario posizionare un secchio per le acque reflue sotto lo scarico del pianale del veicolo della vostra roulotte. I servizi igienici per camper e altri rifiuti liquidi devono essere svuotati o smaltiti solo nei punti di smaltimento designati. Attribuisci grande importanza anche alla pulizia e all\'ordine. Quando si utilizza il bagno e il blocco doccia, si presume che tutti gli ospiti siano sempre attenti e premurosi. Aiutaci a mantenere la tenuta e le strutture pulite e in ordine!\r\n\r\n8. Sono consentite le griglie a carbone purché il fumo non disturbi i vicini e il prato o il pavimento non siano danneggiati.\r\n\r\n9. I cani non sono ammessi in piscina. Non sono ammessi giochi con la palla e materassi ad aria. È vietato saltare dal bordo della piscina!\r\n\r\n10. Ogni ospite deve prendersi cura dei propri effetti personali. La direzione garantisce un monitoraggio continuo del campeggio, ma non risponde di eventuali furti o smarrimenti. Prenditi sempre cura dei tuoi effetti personali e prendi le misure precauzionali necessarie. Denaro e oggetti di valore non dovrebbero essere in giro incustoditi in roulotte, tende e alloggi.\r\n\r\n11. Eventuali interruzioni della fornitura di energia elettrica o acqua, causate da guasti o cause di forza maggiore, non obbligano il campeggio al rimborso del prezzo.\r\n\r\n12. Il campeggio non risponde inoltre di eventuali danni causati da temporali (vento, grandine, caduta di rami).\r\n\r\n13. L\'uso di attrezzature sportive e ricreative, piscina, parco giochi, campo da calcio e pallavolo, ecc. è a proprio rischio. I minorenni possono utilizzare i servizi igienici o le attrezzature del campeggio solo se accompagnati da un supervisore. La direzione declina ogni responsabilità per eventuali incidenti.\r\n\r\n14. I bambini devono essere sempre accompagnati dai genitori durante le attività di animazione. La direzione declina ogni responsabilità per eventuali incidenti che dovessero capitare a bambini incustoditi. Lo staff di animazione non offre assistenza all\'infanzia.','All\'interno dell\'aeroporto uno dei nostri accompagnatori incontrerà il bambino all\'uscita dopo il ritiro bagagli. Durante il viaggio di ritorno ci assicureremo che il vostro bambino abbia effettuato correttamente il check-in e esegua il controllo di sicurezza. Assicurati di informarci al più tardi 4 settimane prima della partenza e di fornire orari di viaggio e numeri di volo e di prendere nota delle diverse normative delle compagnie aeree relative ai bambini che viaggiano da soli. In alcuni aeroporti offriamo il ristorante McDonald\'s come punto di incontro, ad es. per i genitori che volano insieme ai figli o per i bambini che abitano nelle vicinanze e non viaggiano in aereo.'),(4,2,'it','Sun and Sea Campeggio','L\'esperienza familiare','Il campeggio è tutto coperto da tre per un fresco relax durante tutta l\'estate.','Situato a 4 km dal villaggio di SOSPEL, situato in un ambiente naturale privilegiato, aperto dal 15 aprile al 30 settembre.\r\n\r\nIl campeggio vi accoglie con 90 piazzole di cui 13 alloggi su un terreno di oltre 3 ettari di terreno e terrazze.\r\nRoulotte e camper sono i benvenuti e avranno un posto nella parte inferiore del campeggio, la parte superiore non è accessibile a camper e veicoli di grandi dimensioni.\r\nTutti gli spot hanno un collegamento elettrico da 10 A (per alcuni di voi, assicuratevi di avere una prolunga).\r\n\r\nUna piscina è aperta tutta la stagione e gratuita per i nostri residenti.\r\n\r\nCi auguriamo che il fascino e l\'autenticità di questo luogo vi piacciano.\r\n\r\nAccessibilità: il campeggio dispone di piazzola e doccia e servizi igienici per persone a mobilità ridotta, ma il terreno a causa della sua topografia è di difficile accessibilità.','Check-in e Check-out:\r\nSi accettano check-in fino alle ore 18.00, Se si prevede di arrivare oltre tale orario, si prega di contattarci al più presto per farcelo sapere (max. fino alle ore 23.00). I posti devono essere liberati entro le ore 11.00 del giorno di partenza e le case mobili entro le ore 10.00.\r\n\r\nSoggiorno minimo\r\nPer prenotare le piazzole non è richiesto un soggiorno minimo. Il soggiorno minimo è indicato nel listino prezzi per la prenotazione di case mobili.\r\n\r\nCaparra per la prenotazione\r\nLa prenotazione si intende confermata al ricevimento della caparra, pari al 30% dell\'importo totale del soggiorno, comunicata al momento della prenotazione, quota di soggiorno esclusa. L\'importo minimo richiesto per il deposito è di 21,00€.\r\n\r\nCancellazioni prenotazioni e no-show\r\n\r\nE\' possibile cancellare gratuitamente la prenotazione fino a 21 giorni prima della data di arrivo, al netto di 2€ di spese di transazione. In tutti gli altri casi, compreso il no show, per qualsiasi motivo la caparra non verrà restituita.\r\n\r\nMetodo di pagamento per il deposito\r\nE\' possibile versare la caparra tramite bonifico bancario a:\r\n\r\nBellavista Riviera S.n.c. di Curzel Cristina & C.\r\nIBAN: IT41 A058 5635 2200 7757 1378 215\r\nBanca: Banca Popolare dell\'Alto Adige S.p.a.\r\nBIC / SWIFT: BPAAIT2B077\r\n\r\nindicando nella causale il numero di prenotazione associato, fornito dalla reception del campeggio.\r\n\r\nPagamento dell\'importo residuo\r\nIl restante importo può essere pagato direttamente in campeggio:\r\n\r\n• per prenotazioni di case mobili il giorno dell\'arrivo\r\n• per la prenotazione delle piazzole entro il giorno prima della partenza prevista.\r\n\r\nPuoi pagare il tuo conto con contanti, bancomat, carta di credito sul circuito VISA/MASTERCARD.\r\n\r\nSolo per l\'importo della tassa di soggiorno è richiesto l\'utilizzo di contanti. Non si accettano assegni.\r\n\r\nSi prega di pagare il conto solo in questo orario: 8:00 – 11:00 e 17:00 – 19:00.','A nessuno piace sentire parlare delle regole (almeno, pensiamo), ma le nostre regole del campeggio sono create pensando a te e aiutano a garantire che tutti sul posto abbiano la migliore esperienza possibile.  Sappiamo che non ci saranno problemi, ma per salvaguardare la vostra vacanza e il vostro relax chiediamo rispettosamente a tutti di attenersi a quanto segue:  Ricezione Gli orari di apertura saranno esposti alla Reception. Quando la reception è chiusa, sulla porta verrà visualizzato un numero di contatto di emergenza per il responsabile del sito. Le informazioni turistiche locali sono disponibili alla reception. Per maggiori informazioni sulla zona, non esitate a chiedere al Responsabile del Sito.  Arrivo partenza Le piazzole sono disponibili da mezzogiorno del giorno di arrivo. Siete pregati di lasciare la vostra piazzola entro le ore 11:00 del giorno di partenza. Se desideri prolungare il soggiorno, ti preghiamo di contattare la Reception entro le ore 10:00 della data di partenza prevista. I permessi rilasciati alla Reception devono essere sempre esposti.  Arrivi Puoi lanciare prima o al tramonto.  Se arrivate quando la Reception è chiusa, siete pregati di chiamare il numero di telefono che si trova sulla porta della Reception. I siti generalmente aprono dalle 7:30 alle 22:30, ma questo varia a seconda del sito.  Piazzole Si prega di notare che, a causa delle normative antincendio, è necessario lanciare almeno tre, preferibilmente sei, metri di distanza da chiunque altro. Sfortunatamente se questa regola non viene rispettata ti potrebbe essere chiesto di ripetere (e non piace a nessuno). Troverai estintori in punti importanti del sito, ti preghiamo di informarti di dove si trovano. Consentito un frangivento per piazzola, con un massimo di sei pali.  Limite di velocità Il limite di velocità in loco è di 5 mph. Poiché spesso ci sono bambini piccoli che giocano, ti chiediamo di prestare particolare attenzione durante la guida in loco.  Per favore, supera lentamente i cavalli.  Generatori I generatori sono ammessi solo se indicati dalla direzione. Laddove i generatori sono ammessi, si prega di rispettare gli orari in cui consentiamo a questi di funzionare.  Barbecue A causa del pericolo di incendi nella foresta, non sono ammessi fuochi aperti in loco.  Eventuali barbecue utilizzati sui nostri siti devono essere progettati e utilizzati esclusivamente allo scopo di cucinare cibo (cioè non bracieri). Dovrebbero essere robusti, sicuri e in grado di essere sollevati dal suolo della foresta, senza danni o segni lasciati sul terreno dove sono stati utilizzati. A sostegno del New Forest Action Plan chiediamo ai campeggiatori di non portare barbecue usa e getta per il loro soggiorno. Ricordiamo inoltre ai campeggiatori che al di fuori dei nostri siti non sono consentiti barbecue di alcun tipo in nessuna parte della New Forest.','Arrivo con i mezzi pubblici\r\n\r\nArrivo in treno: Prendere la linea 400, scendere a Dobbiaco e prendere l\'autobus 445 fino alla fermata Lago di Dobbiaco - il nostro campeggio e gli Skyview Chalets sono a 200 metri dalla fermata dell\'autobus.\r\n\r\nArrivo con il Südtirol Transfer\r\n\r\nSe arrivate in Alto Adige in treno o autobus, il servizio navetta \"Südtirol Transfer\" può portarvi gli ultimi chilometri fino al vostro alloggio: le navette partono dalle stazioni di Bolzano, Merano, Malles, Bressanone, Brunico e San Candido e dalle fermate degli autobus a lunga percorrenza di Bolzano, Chiusa, Varna, Vipiteno e Merano; e, a fine soggiorno, ti riporteranno alla fermata dell\'autobus. Puoi prenotare questo servizio su www.suedtiroltransfer.com .');
